⠀
1️⃣Наиболее популярный вопрос: откуда так быстро завелся мужчина? Ох уж это ЗАВЕЛСЯ! Завести можно пёсика или котика. Рыбок. Попугаев. Можно завести стадо баранов и, даже, зарабатывать на этом - ферма называется. Но! МУЖЧИНУ ЗАВЕСТИ НЕЛЬЗЯ! 🔞 если речь не про сексуальные прелюдии идёт 😎⠀
⠀
2️⃣ Второй: где собственно свадьба? Ребят, ее не было!!! ну не то настроение в моей семье сейчас, что бы праздновать, КАК МЫ ЭТО УМЕЕМ! Получилось так: мы с Димой придумали, час провисели на линию в ЗАГС- не довиселись🤦🏻‍♀️, сделали пару звонков и ВУАЛЯ - через 14 дней стали мужем и женой. И ДА! отсюда вытекает 3 вопрос ⤵️⠀
⠀
3️⃣Нет! Я не беременна 🤰! У меня контракт рабочий, мне нельзя!🤷🏻‍♀️ ⠀
⠀
4️⃣ Мое любимое: ФАМИЛИЯ! Ребята, у меня настолько понимающий муж, что когда я изъявила желание оставить СВОЮ ( по разным причинам), мне пошли навстречу!😍⠀
⠀
5️⃣ Почему его нет на моих видео и т.д ( ЕГО, всмысле мужа) - не любит соц.сети. ОСОБЕННО инст🙅- я принимаю 😀 и снимаю кучу для СЕБЯ, так сказать в home...⠀
⠀
P.S В общем, все как я люблю: сказали-сделали, костюмы ( платья ,кстати, тоже не было😂), паспорта, кольца и лимузин! И куча приятных воспоминаний о лучшем друге- который теперь ОФИГЕННЫЙ муж💋⠀⠀
